__NUXT_JSONP__("/en/categories/Winkels", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){d.id=c;d.name="Fiets- en wandelstartpunt Hippolytushoef";d.name_en="Cycling and walking starting point Hippolytushoef";d.name_de="Ausgangspunkt für Rad- und Wandertouren";d.coordinates="52.90693191602117, 4.961311405035104";d.enabled=a;d.category=g;f.id=e;f.name="Fiets- en wandelstartpunt Den Oever";f.name_en="Cycling and walking starting point Den Oever";f.name_de="Ausgangspunkt für Rad- und Wandertouren Den Oever";f.coordinates="52.93029966957933, 5.031214240429179";f.enabled=a;f.category=g;return {data:[{category:b,locations:[{id:"62ee33a6b974cb2998dd10ee",name:"Bakkerij Dunselman",category:b,coordinates:"52.90698315978778, 4.961375172715638",description:"\u003Cp\u003E\u003Cstrong\u003EWij bakken voor jou!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EEn dat doen we al 160 jaar bij Bakkerij Dunselman. Vanaf de oprichting van ons familiebedrijf, tot en met de laatste ontwikkelingen nu: die slogan blijft op ons van toepassing. Lekkere producten zijn namelijk altijd de basis geweest van ons bestaansrecht.\u003C\u002Fp\u003E\u003Cp\u003EOnze heerlijke broden, de smaakvolle taarten en gebakjes en de lekkere koekjes. Iedere dag weer staan ze bij duizenden mensen, die er dagelijks van genieten. Dat kan mede dankzij onze vele winkels in alle wijken in Den Helder en Julianadorp. De bereikbaarheid voor klanten is daardoor optimaal.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EWe bake for you!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAnd we have been doing this for 160 years at Bakery Dunselman. From the foundation of our family business, up to and including the latest developments: that slogan continues to apply to us. Tasty products have always been the basis of our existence.\u003C\u002Fp\u003E\u003Cp\u003EOur delicious breads, the tasteful cakes and pastries and the delicious cookies. Every day they are with thousands of people, who enjoy them every day. This is possible thanks to our many shops in all neighborhoods in Den Helder and Julianadorp. The accessibility for customers is therefore optimal.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EWir backen für Sie!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EUnd das tun wir bei Bakery Dunselman seit 160 Jahren. Von der Gründung unseres Familienunternehmens bis hin zu den neuesten Entwicklungen: Dieser Slogan gilt bis heute für uns. Schmackhafte Produkte sind seit jeher die Grundlage unserer Existenz.\u003C\u002Fp\u003E\u003Cp\u003EUnsere leckeren Brote, die geschmackvollen Kuchen und Backwaren und die leckeren Plätzchen. Jeden Tag sind sie bei Tausenden von Menschen, die sich jeden Tag daran erfreuen. Dies ist dank unserer vielen Geschäfte in allen Stadtteilen von Den Helder und Julianadorp möglich. Die Erreichbarkeit für Kunden ist somit optimal.\u003C\u002Fp\u003E",phone:"0227591594",site:"http:\u002F\u002Fwww.bakkerijdunselman.nl\u002F",enabled:a},{id:"62ee3485b974cb2998dd10ef",name:"Bloemennis",category:b,coordinates:"52.906392221243735, 4.96108639610119",description:"\u003Cp\u003E\u003Cstrong\u003EWELKOM BIJ BLOEMENNIS, DE MOOISTE BLOEMEN EN PLANTEN!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EMidden in het hart van Hippolytushoef is onze knusse bloemenwinkel Bloemennis gevestigd.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWij bezorgen op heel Wieringen en in de Wieringermeer. Doordat wij zijn aangesloten bij de organisatie “Webbloemen” is bezorgen overal in Nederland mogelijk, en vaak ook daar buiten.\u003C\u002Fp\u003E\u003Cp\u003EWij houden van persoonlijke aandacht, gezelligheid en creativiteit en staan open voor alle vragen en wensen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EWELCOME TO BLOEMENNIS, THE MOST BEAUTIFUL FLOWERS AND PLANTS!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EOur cozy flower shop Bloemennis is located right in the heart of Hippolytushoef.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe deliver throughout Wieringen and in the Wieringermeer. Because we are affiliated with the organization \"Webbloemen\" delivery is possible everywhere in the Netherlands, and often also outside.\u003C\u002Fp\u003E\u003Cp\u003EWe love personal attention, conviviality and creativity and are open to all questions and wishes.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EWILLKOMMEN BEI BLOEMENNIS, DEN SCHÖNSTEN BLUMEN UND PFLANZEN!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EUnser gemütliches Blumengeschäft Bloemennis befindet sich direkt im Herzen von Hippolytushoef.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir liefern in ganz Wieringen und im Wieringermeer. Da wir der Organisation \"Webbloemen\" angeschlossen sind, ist eine Lieferung überall in den Niederlanden und oft auch außerhalb möglich.\u003C\u002Fp\u003E\u003Cp\u003EWir lieben persönliche Betreuung, Geselligkeit und Kreativität und sind offen für alle Fragen und Wünsche.\u003C\u002Fp\u003E",email:"info@bloemennis.nl",phone:"0628526978",site:"http:\u002F\u002Fwww.bloemennis.nl\u002F",enabled:a},{id:"62ee353bb974cb2998dd10f0",name:"Bocado Kaas & Delicatessen",category:b,coordinates:"52.90588225942224, 4.960814744076642",description:"\u003Cp\u003EBocado kaas en delicatessen: hét adres in Noord-Holland voor echte fijnproevers.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EWij staan voor puur, verfijnd en verantwoord. Onze producten zijn met smaak en aandacht geselecteerd. Vanuit liefde en passie voor eten.\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.bocado.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1020\u002Fbocado-hippolytushoef-klein.jpg\" width=\"680\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EBocado is ook uw kaasspecialist!\u003C\u002Fp\u003E\u003Cp\u003EBij ons kunt u terecht voor een groot assortiment Hollandse- en buitenlandse kaas. De Noord Hollandse kazen zijn o.a. van het merk SmaaQ. Noord-Hollandse kaas is zeer bekend bij de consument, het staat synoniem voor kwaliteit en een heerlijke smaak: SmaaQ met de Q van Qualiteit. SmaaQ is in samenwerking met CONO Kaasmakers exclusief voor de Kaasspeciaalzaken ontwikkeld.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EOok hebben we altijd een mooi assortiment Boeren kazen op de plank liggen. Boeren kazen zijn gemaakt van rauwe melk en daardoor heerlijk vol en romig van smaak.\u003C\u002Fp\u003E\u003Cp\u003EBuitenlandse kazen, rechtstreeks geïmporteerd van de producent. Halfgare kaas, blauw-geaderde kaas, gewassen roodkorst, witte korstkaas en verse roomkazen. Er zijn kazen uit o.a. Frankrijk, Belgie, Duitsland, Spanje, Italie en Zwitserland. Kom het gehele assortiment bekijken en proeven in onze winkel!\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EBocado cheese and delicacies: the address in North Holland for true gourmets.\u003C\u002Fp\u003E\u003Cp\u003EWe stand for pure, refined and responsible. Our products are selected with taste and attention. Out of love and passion for food.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003Cimg src=\"https:\u002F\u002Fwww.bocado.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1020\u002Fbocado-hippolytushoef-klein.jpg\" width=\"680\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EBocado is also your cheese specialist!\u003C\u002Fp\u003E\u003Cp\u003EYou can come to us for a wide range of Dutch and foreign cheese. The North Holland cheeses are, among others, of the SmaaQ brand. North Holland cheese is well known to consumers, it is synonymous with quality and a delicious taste: SmaaQ with the Q for Quality. SmaaQ was developed in collaboration with CONO Kaasmakers exclusively for the cheese specialty shops.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe also always have a nice range of Farmer's cheeses on the shelf. Farmers cheeses are made from raw milk and therefore have a wonderfully full and creamy taste.\u003C\u002Fp\u003E\u003Cp\u003EForeign cheeses, imported directly from the producer. Semi-cooked cheese, blue-veined cheese, washed red rind, white rind cheese and fresh cream cheeses. There are cheeses from France, Belgium, Germany, Spain, Italy and Switzerland. Come see and taste the entire range in our store!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EBocado-Käse und Delikatessen: die Adresse in Nordholland für echte Feinschmecker.\u003C\u002Fp\u003E\u003Cp\u003EWir stehen für pur, raffiniert und verantwortungsbewusst. Unsere Produkte werden mit Geschmack und Aufmerksamkeit ausgewählt. Aus Liebe und Leidenschaft zum Essen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E&nbsp;\u003Cimg src=\"https:\u002F\u002Fwww.bocado.nl\u002Fsite\u002Fassets\u002Ffiles\u002F1020\u002Fbocado-hippolytushoef-klein.jpg\" width=\"680\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EBocado ist auch Ihr Käsespezialist!\u003C\u002Fp\u003E\u003Cp\u003EBei uns finden Sie eine große Auswahl an niederländischem und ausländischem Käse. Die nordholländischen Käsesorten sind unter anderem von der Marke SmaaQ. Nordholländischer Käse ist dem Verbraucher ein Begriff, er steht für Qualität und einen köstlichen Geschmack: SmaaQ mit dem Q für Qualität. SmaaQ wurde in Zusammenarbeit mit CONO Kaasmakers exklusiv für den Käsefachhandel entwickelt.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAußerdem haben wir immer eine schöne Auswahl an Bauernkäse im Regal. Bauernkäse werden aus Rohmilch hergestellt und haben daher einen wunderbar vollen und cremigen Geschmack.\u003C\u002Fp\u003E\u003Cp\u003EAusländische Käsesorten, direkt vom Erzeuger importiert. Halbgekochter Käse, Blauschimmelkäse, gewaschener Rotschimmelkäse, Weißschimmelkäse und Frischkäse. Es gibt Käse aus Frankreich, Belgien, Deutschland, Spanien, Italien und der Schweiz. Kommen Sie und probieren Sie das gesamte Sortiment in unserem Geschäft!\u003C\u002Fp\u003E",email:"​info@bocado.nl",phone:"0655521877",site:"http:\u002F\u002Fwww.bocado.nl\u002F",enabled:a},{id:"62ee359fb974cb2998dd10f1",name:"DekaMarkt Hippolytushoef",category:b,coordinates:"52.9060398654454, 4.960974167731249",description:"\u003Cp\u003EDirk Kat opent in 1941 een kruidenierszaak. Hij opent in 1949 onder de naam Kijkgrijp in Velsen-Noord zijn eerste zelfbedieningswinkel. Het familiebedrijf DekaMarkt heeft 99 winkels in de provincies Noord- en Zuid-Holland, Gelderland, Overijssel, Utrecht en Flevoland. Ook hebben we een bezorgservice (online boodschappen doen).&nbsp;De supermarktketen is sinds 1 januari 2009 onderdeel van Detailresult Groep N.V. Detailresult Groep N.V heeft behalve diverse supermarktformules ook eigen productiebedrijven, diverse distributiecentra, verscentrales en transport. Tot slot zijn er aan het bedrijf gelieerde tuincentra en slijterijen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EDirk Kat opens a grocery store in 1941. In 1949, he opened his first self-service store under the name Kijk Grip in Velsen-Noord. The family business DekaMarkt has 99 stores in the provinces of North and South Holland, Gelderland, Overijssel, Utrecht and Flevoland. We also have a delivery service (online shopping). The supermarket chain has been part of Detailresult Groep N.V. since 1 January 2009. In addition to various supermarket formulas, Detailresult Groep N.V also has its own production companies, various distribution centers, fresh produce centers and transport. Finally, there are garden centers and liquor stores affiliated with the company.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDirk Kat eröffnet 1941 ein Lebensmittelgeschäft. 1949 eröffnete er sein erstes Selbstbedienungsgeschäft unter dem Namen Kijk Grip in Velsen-Noord. Das Familienunternehmen DekaMarkt hat 99 Filialen in den Provinzen Nord- und Südholland, Gelderland, Overijssel, Utrecht und Flevoland. Wir haben auch einen Lieferservice (Online-Shopping). Die Supermarktkette gehört seit dem 1. Januar 2009 zur Detailresult Groep N.V. Neben verschiedenen Supermarktformeln verfügt die Detailresult Groep N.V auch über eigene Produktionsbetriebe, verschiedene Vertriebszentren, Frischwarenzentren und Transport. Schließlich gibt es Gartencenter und Spirituosengeschäfte, die dem Unternehmen angeschlossen sind.\u003C\u002Fp\u003E",phone:"0883135385",site:"https:\u002F\u002Fwww.dekamarkt.nl\u002F",enabled:a},{id:"62ee3638b974cb2998dd10f2",name:"Embrace Damesmode",category:b,coordinates:"52.906727828251626, 4.961237650343475",description:"\u003Cp\u003EJouw mode avontuur begint hier!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EYour fashion adventure starts here!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDein Fashion-Abenteuer beginnt hier!\u003C\u002Fp\u003E",email:"hippolytushoef@embrace.nl",phone:"0227591237",site:"http:\u002F\u002Fwww.embrace.nl\u002F",enabled:a},{id:"62ee3700b974cb2998dd10f3",name:"Etos Koops Drogisterij",category:b,coordinates:"52.907218343946035, 4.961457522475183",description:"\u003Cp\u003EEtos is al meer dan honderd jaar jouw vertrouwde drogist. In de winkel én online. Met ruim 550 filialen door heel Nederland is er altijd een Etos drogist bij jou in de buurt. Wat je vraag ook is, we helpen je verder.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEtos has been your trusted drugstore for over a hundred years. In-store and online. With more than 550 branches throughout the Netherlands, there is always an Etos drugstore near you. Whatever your question is, we'll help you.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EEtos ist seit über hundert Jahren die Drogerie Ihres Vertrauens. Im Geschäft und online. Mit mehr als 550 Filialen in den Niederlanden ist immer eine Etos-Apotheke in Ihrer Nähe. Was auch immer Ihre Frage ist, wir helfen Ihnen.\u003C\u002Fp\u003E",phone:"0227593100",site:"https:\u002F\u002Fwww.etos.nl",enabled:a},{id:"62ee376eb974cb2998dd10f4",name:"Kater Funsport",category:b,logo:"",coordinates:"52.901941515076864, 4.953470032950141",description:"\u003Cp\u003EKATER FUNSPORT is zowel in de zomer als in de winter de place to be. Met ruim 35 jaren ervaring en een totaal winkeloppervlak van meer dan 3500m2 : funshoppen voor het hele gezin! Specialist in windsurfen, kitesurfen, stand up paddle en waterwear. Skiën, snowboarden en wintersportkleding. Een enorm aanbod fashion : trendy, outdoor en sportief. Professionele webshop. Uitstekende service. De coolste deals.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EKATER FUNSPORT is the place to be in both summer and winter. With over 35 years of experience and a total retail area of ​​more than 3500m2, fun shopping for the whole family! Specialist in windsurfing, kitesurfing, stand up paddle and waterwear. Skiing, snowboarding and winter sportswear. A huge range of fashion: trendy, outdoor and sporty. Professional webshop. Outstanding service. The coolest deals.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EKATER FUNSPORT ist der Place to be im Sommer wie im Winter. Mit über 35 Jahren Erfahrung und einer Gesamtverkaufsfläche von mehr als 3500 m2 macht das Einkaufen Spaß für die ganze Familie! Spezialist für Windsurfen, Kitesurfen, Stand Up Paddle und Waterwear. Skifahren, Snowboarden und Wintersportbekleidung. Eine riesige Auswahl an Mode: trendig, outdoor und sportlich. Professioneller Webshop. Hervorragenden Service. Die coolsten Angebote.\u003C\u002Fp\u003E",email:"webshop@kater.nl",phone:"0227593888",site:"https:\u002F\u002Fwww.kater.nl\u002F",sponsor_walking_wieringen:a,enabled:a},{id:"62ee37d6b974cb2998dd10f5",name:"Kringloopwinkel Twice",category:b,coordinates:"52.903332200500145, 4.9509608090203425",description:"\u003Cp\u003ELaten we ons rijk voelen en bedachtzaam en zorgvuldig omgaan met elkaar, onze spullen en onze natuur.\u003C\u002Fp\u003E\u003Cp\u003EWees wijs en kom naar Twice!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ELet's feel rich and be thoughtful and careful with each other, our stuff and our nature.\u003C\u002Fp\u003E\u003Cp\u003EBe wise and come to Twice!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ELasst uns uns reich fühlen und rücksichtsvoll und achtsam miteinander, mit unseren Sachen und unserer Natur umgehen.\u003C\u002Fp\u003E\u003Cp\u003ESei weise und komm zu Twice!\u003C\u002Fp\u003E",email:"info@kringloopwinkeltwice.nl",phone:"0625476676",site:"https:\u002F\u002Fwww.kringloopwinkeltwice.nl\u002F",enabled:a},{id:"62ee387fb974cb2998dd10f6",name:"Detectiespecialist D.J. Laan",category:b,coordinates:"52.905759658794544, 4.96111332934346",description:"\u003Cp\u003EDetectiespecialist D.J. Laan in Hippolytushoef biedt een compleet assortiment detectieapparatuur aan voor archeologen en hobbyisten, grondverzet en beveiliging.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EDetection specialist D.J. Laan in Hippolytushoef offers a complete range of detection equipment for archaeologists and hobbyists, earthmoving and security.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDetektionsspezialist D.J. Laan in Hippolytushoef bietet ein komplettes Sortiment an Ortungsgeräten für Archäologen und Bastler, Erdbewegung und Sicherheit.\u003C\u002Fp\u003E",email:"info@djlaan.nl",phone:"0227593286",site:"https:\u002F\u002Fwww.djlaan.nl\u002F",enabled:a},{id:"62ee3939b974cb2998dd10f7",name:"MotoPort",category:b,coordinates:"52.90151649584449, 4.951507378378129",description:"\u003Cp\u003EMotorrijden is zoveel meer dan opstappen en wegrijden. Het is een samenspel van techniek en stijl, snelheid en geluid, adrenaline en beheersing, knietje aan de grond en stug kilometervreten, woon-werk en puur avontuur. Wat voor motorrijder je ook bent, MotoPort wil voor jou het startpunt zijn van elke veilige rit. Met een motor waar je je één mee voelt, met een helm en kleding die als gegoten zitten en de zekerheid dat het onderhoud tot op de newtonmeter goed zit. Dát is waar MotoPort voor staat. Daarom hebben we méér in huis voor elke motorrijder. Méér&nbsp;nieuwe&nbsp;en&nbsp;gebruikte&nbsp;motoren en scooters. Méér&nbsp;helmen&nbsp;en&nbsp;kleding. Méér&nbsp;accessoires&nbsp;om het maximale uit elke rit te halen. Méér technische kennis van jouw motor. En méér advies,&nbsp;service&nbsp;en inspiratie om jouw leven als motorrijder compleet te maken, zodat je vol vertrouwen kunt opstappen en wegrijden.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ERiding a motorcycle is so much more than getting on and riding off. It is an interplay of technique and style, speed and sound, adrenaline and control, knee to the ground and stiff miles, commuting and pure adventure. Whatever kind of motorcyclist you are, MotoPort wants to be the starting point for every safe ride for you. With an engine that you feel at one with, with a helmet and clothing that fit like a glove and the certainty that maintenance is right down to the newton meter. That is what MotoPort stands for. That is why we have more to offer for every motorcyclist. More new and used motorcycles and scooters. More helmets and clothing. More accessories to get the most out of every ride. More technical knowledge of your engine. And more advice, service and inspiration to make your life as a motorcyclist complete, so that you can get on and drive off with confidence.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMotorradfahren ist so viel mehr als auf- und abfahren. Es ist ein Zusammenspiel von Technik und Stil, Geschwindigkeit und Sound, Adrenalin und Kontrolle, Knie auf dem Boden und steife Meilen, Pendeln und pures Abenteuer. Welche Art von Motorradfahrer Sie auch sind, MotoPort möchte für Sie der Ausgangspunkt für jede sichere Fahrt sein. Mit einem Motor, mit dem man sich wohlfühlt, mit Helm und Kleidung, die wie angegossen sitzen, und der Gewissheit, dass die Wartung auf den Newtonmeter genau ist. Dafür steht MotoPort. Deshalb haben wir für jeden Motorradfahrer mehr zu bieten. Mehr neue und gebrauchte Motorräder und Roller. Mehr Helme und Kleidung. Mehr Zubehör, um das Beste aus jeder Fahrt herauszuholen. Mehr technisches Wissen über Ihren Motor. Und noch mehr Beratung, Service und Inspiration, um Ihr Leben als Motorradfahrer komplett zu machen, damit Sie selbstbewusst aufsteigen und losfahren können.\u003C\u002Fp\u003E",phone:"0227591639",site:"http:\u002F\u002Fwww.motoport.nl\u002Fhippolytushoef",enabled:a},{id:"62ee3a36b974cb2998dd10f8",name:"Slagerij Piet Ottens",category:b,coordinates:"52.90602812116871, 4.961034095918859",description:"\u003Cp\u003E\u003Cstrong\u003EWelkom bij Uw Slager Piet Ottens\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWij zijn de specialist op het gebied van vers vlees! Ons rundvlees komt rechtstreeks van de boerderij waar de runderen in alle rust opgroeien op de grazige Wieringerweide. Maar ook voor lekkere specialiteiten uit onze eigen worstmakerij kunt u terecht, de grill draait iedere dag!\u003C\u002Fp\u003E\u003Cp\u003EOp deze site willen wij u graag een indruk geven van onze specialiteiten en u laten zien waar en hoe al dat lekkers gemaakt wordt. Heeft u inmiddels trek gekregen? Kom dan eens kijken in onze winkel.\u003C\u002Fp\u003E\u003Cp\u003EMet vriendelijke groet,\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EPiet Ottens &amp; medewerkers\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fuwslager.blob.core.windows.net\u002Fimages\u002Fottens\u002Fpage\u002Fwelkom-bij-uw-slager-ottens_d0a737\u002F3ca308_3ca354.jpg?v=581b966b96cf21f4b867ae8fb0920b5c\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EAlles voor de lekkerste barbecue!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EBij Uw Slager Piet Ottens is er volop keuze uit verschillende soorten barbecue menu's en pakketten!&nbsp;Kijk gerust ook eens bij ons assortiment salades, onze losse BBQ producten of onze BBQ specialiteiten.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EWelcome to Your Butcher Piet Ottens\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe are the specialist in the field of fresh meat! Our beef comes directly from the farm where the cattle grow up in peace on the grassy Wieringerweide. But you can also enjoy tasty specialties from our own sausage factory, the grill is running every day!\u003C\u002Fp\u003E\u003Cp\u003EOn this site we would like to give you an impression of our specialties and show you where and how all those goodies are made. Have you gotten hungry by now? Then come and have a look in our store.\u003C\u002Fp\u003E\u003Cp\u003ESincerely,\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EPiet Ottens &amp; employees\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fuwslager.blob.core.windows.net\u002Fimages\u002Fottens\u002Fpage\u002Fwelkom-bij-uw-slager-ottens_d0a737\u002F3ca308_3ca354.jpg?v=581b966b96cf21f4b867ae8fb0920b5c\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EEverything for the tastiest barbecue!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAt Uw Slager Piet Ottens there is plenty of choice from different types of barbecue menus and packages! Feel free to take a look at our range of salads, our individual BBQ products or our BBQ specialties.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EWillkommen bei Ihrem Metzger Piet Ottens\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir sind der Spezialist im Bereich Frischfleisch! Unser Rindfleisch kommt direkt vom Hof, wo die Rinder in Ruhe auf der grasbewachsenen Wieringerweide aufwachsen. Aber auch leckere Spezialitäten aus unserer hauseigenen Wurstmanufaktur können Sie genießen, der Grill läuft täglich!\u003C\u002Fp\u003E\u003Cp\u003EAuf dieser Seite möchten wir Ihnen einen Eindruck unserer Spezialitäten vermitteln und Ihnen zeigen, wo und wie all diese Leckereien hergestellt werden. Bist du inzwischen hungrig geworden? Dann schauen Sie doch mal in unserem Shop vorbei.\u003C\u002Fp\u003E\u003Cp\u003EAufrichtig,\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EPiet Ottens &amp; Mitarbeiter\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fuwslager.blob.core.windows.net\u002Fimages\u002Fottens\u002Fpage\u002Fwelkom-bij-uw-slager-ottens_d0a737\u002F3ca308_3ca354.jpg?v=581b966b96cf21f4b867ae8fb0920b5c\"\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EAlles für das leckerste Barbecue!\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EBei Uw Slager Piet Ottens gibt es eine große Auswahl an verschiedenen Arten von Grillmenüs und -paketen! Werfen Sie gerne einen Blick in unser Salatsortiment, unsere individuellen BBQ-Produkte oder unsere BBQ-Spezialitäten.\u003C\u002Fp\u003E",email:"info@ottens.uw-slager.nl",phone:"0227591269",site:"http:\u002F\u002Fwww.slagerijottens.nl\u002F",enabled:a},{id:"62ee3ab6b974cb2998dd10f9",name:"Praxis Bouwmarkt",category:b,coordinates:"52.90038094907517, 4.948395622534181",description:"\u003Ch4\u003EDoe-het-zelf bouwmarkt Hippolytushoef\u003C\u002Fh4\u003E\u003Cp\u003EPraxis is dé bouwmarkt in Hippolytushoef waar je naar toe kunt voor al je doe-het-zelf klusartikelen. Of je nu een grote of kleine klus gaat verrichten; bij Hippolytushoef vind je alles wat je nodig hebt om van jouw klus een succes te maken. Zoek je inspiratie of advies over producten? Stel je vraag: onze deskundige medewerkers helpen je graag op weg. We zijn bijna elke dag open, maar voor de zekerheid bekijk je onze website voor een overzicht van alle openingstijden van Praxis Hippolytushoef. Zo weet je zeker dat je niet voor een gesloten deur staat, bijvoorbeeld op zon- en feestdagen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch4\u003ESterk in laminaat, verf en gereedschap\u003C\u002Fh4\u003E\u003Cp\u003EBij de Praxis in Hippolytushoef vind je alle bouwmaterialen, gereedschap en accessoires om je huis nog mooier te maken. Zowel de beginnende als de ervaren makers kunnen bij Hippolytushoef terecht voor hun klus benodigdheden. Ga je de muren van een nieuw laagje verf of behang voorzien? Wil je dat oude tapijt nu eindelijk eens verwisselen voor een mooie laminaatvloer? Of vind je het gewoon leuk om je eigen tuinmeubelen van steigerhout te maken? Hippolytushoef helpt je graag bij het realiseren van jouw klus. Ontdek het veelzijdige assortiment van de Praxis in Hippolytushoef of bekijk het aanbod online via praxis.nl.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E\u003Cstrong\u003EDo-it-yourself hardware store Hippolytushoef\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EPraxis is the hardware store in Hippolytushoef where you can go for all your do-it-yourself DIY items. Whether you are going to carry out a large or small job; at Hippolytushoef you will find everything you need to make your job a success. Are you looking for inspiration or advice about products? Ask your question: our expert employees are happy to help you on your way. We are open almost every day, but just to be sure, check out our website for an overview of all opening hours of Praxis Hippolytushoef. This way you can be sure that you are not standing in front of a closed door, for example on Sundays and public holidays.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EStrong in laminate, paint and tools\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EAt the Praxis in Hippolytushoef you will find all building materials, tools and accessories to make your home even more beautiful. Both the novice and the experienced makers can contact Hippolytushoef for their DIY supplies. Are you going to provide the walls with a new layer of paint or wallpaper? Do you finally want to exchange that old carpet for a beautiful laminate floor? Or do you just enjoy making your own garden furniture from scaffolding wood? Hippolytushoef is happy to help you realize your job. Discover the versatile range of Praxis in Hippolytushoef or view the range online at praxis.nl.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E\u003Cstrong\u003EDo-it-yourself-Baumarkt Hippolytushoef\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EPraxis ist der Baumarkt in Hippolytushoef, in dem Sie alle Heimwerkerartikel kaufen können. Ob Sie einen großen oder kleinen Auftrag ausführen; Bei Hippolytushoef finden Sie alles, was Sie für einen erfolgreichen Job brauchen. Suchen Sie Inspiration oder Beratung zu Produkten? Stellen Sie Ihre Frage: Unsere kompetenten Mitarbeiter helfen Ihnen gerne weiter. Wir haben fast täglich geöffnet, aber um sicherzugehen, finden Sie auf unserer Website eine Übersicht aller Öffnungszeiten der Praxis Hippolytushoef. So können Sie sicher sein, dass Sie beispielsweise an Sonn- und Feiertagen nicht vor verschlossener Tür stehen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003E\u003Cstrong\u003EStark in Laminat, Farbe und Werkzeug\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\u003Cp\u003EBei der Praxis in Hippolytushoef finden Sie alle Baumaterialien, Werkzeuge und Zubehör, um Ihr Zuhause noch schöner zu machen. Sowohl der Anfänger als auch der erfahrene Hersteller können Hippolytushoef für Heimwerkerbedarf kontaktieren. Möchten Sie die Wände mit einer neuen Schicht Farbe oder Tapete versehen? Wollen Sie endlich den alten Teppich gegen einen schönen Laminatboden eintauschen? Oder macht es Ihnen einfach Spaß, Ihre eigenen Gartenmöbel aus Gerüstholz herzustellen? Hippolytushoef unterstützt Sie gerne bei der Umsetzung Ihres Jobs. Entdecken Sie das vielseitige Angebot von Praxis in Hippolytushoef oder sehen Sie sich das Angebot online unter praxis.nl an.\u003C\u002Fp\u003E",phone:"0227592465",site:"https:\u002F\u002Fwww.praxis.nl\u002Fstoredetail\u002F2446\u002Fhippolytushoef",enabled:a},{id:"62ee3b96b974cb2998dd10fa",name:"RL Wheels Fietsen",category:b,coordinates:"52.907612380033065, 4.961454446222156",description:"\u003Cp\u003ERLWheels is de fietsenwinkel en fietsreparatiespecialist te Hippolytushoef, waar u onder meer nieuwe en tweedehands fietsen kunt kopen en uw fiets kunt laten repareren of onderhouden. Remco en Leander zijn als fietsspecialist de drijvende kracht achter RLWheels en zijn u graag van dienst.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg class=\"alignright wp-image-1413\" src=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg\" alt=\"winkelaanzicht\" width=\"384\" height=\"215\" srcset=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg 300w, https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht-280x157.jpg 280w\" sizes=\"(max-width: 384px) 100vw, 384px\" style=\"letter-spacing: 0.00714286em; background-color: rgb(30, 30, 30);\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EOoit als hobby begonnen en nu uitgegroeid tot een professionele fietsenwinkel in Hippolytushoef in de gemeente Hollands Kroon, waar naast de verkoop van nieuwe&nbsp;en tweedehands fietsen en fietsreparatie ook een groot aantal fietsaccessoires te koop wordt aangeboden.\u003C\u002Fp\u003E\u003Cp\u003ERLWheels is een allround fietsenhandel en fietsreparatiebedrijf, waar u bij het kopen van een nieuwe fiets desgewenst meteen een fietsverzekering kunt afsluiten.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ERLWheels is the bicycle shop and bicycle repair specialist in Hippolytushoef, where you can buy new and second-hand bicycles and have your bicycle repaired or maintained. As bicycle specialists, Remco and Leander are the driving force behind RLWheels and are happy to assist you.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cspan style=\"background-color: rgb(30, 30, 30);\"\u003E\u003Cimg src=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg\" alt=\"winkelaanzicht\" height=\"215\" width=\"384\"\u003E\u003C\u002Fspan\u003E\u003C\u002Fp\u003E\u003Cp\u003EIt once started as a hobby and has now grown into a professional bicycle shop in Hippolytushoef in the municipality of Hollands Kroon, where, in addition to the sale of new and second-hand bicycles and bicycle repair, a large number of bicycle accessories are also offered for sale.\u003C\u002Fp\u003E\u003Cp\u003ERLWheels is an all-round bicycle trade and bicycle repair company, where you can immediately take out bicycle insurance when buying a new bicycle.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ERLWheels ist das Fahrradgeschäft und der Fahrradreparaturspezialist in Hippolytushoef, wo Sie neue und gebrauchte Fahrräder kaufen und Ihr Fahrrad reparieren oder warten lassen können. Als Fahrradspezialisten sind Remco und Leander die treibende Kraft hinter RLWheels und helfen Ihnen gerne weiter.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cimg src=\"https:\u002F\u002Fwww.rlwheels.nl\u002Fwp-content\u002Fuploads\u002F2013\u002F01\u002Fwinkelaanzicht.jpg\" alt=\"winkelaanzicht\" height=\"215\" width=\"384\"\u003E\u003C\u002Fp\u003E\u003Cp\u003EEs begann einst als Hobby und hat sich mittlerweile zu einem professionellen Fahrradgeschäft in Hippolytushoef in der Gemeinde Hollands Kroon entwickelt, in dem neben dem Verkauf von neuen und gebrauchten Fahrrädern und der Fahrradreparatur auch eine große Anzahl von Fahrradzubehör angeboten wird zum Verkauf angeboten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003ERLWheels ist ein Allround-Fahrradhandel und Fahrradreparaturbetrieb, bei dem Sie beim Kauf eines neuen Fahrrads sofort eine Fahrradversicherung abschließen können.\u003C\u002Fp\u003E",email:"info@rlwheels.nl",phone:"0618508227",site:"http:\u002F\u002Fwww.rlwheels.nl\u002F",enabled:a},{id:"62ee3c22b974cb2998dd10fb",name:"Sstyle Beenmode",category:b,coordinates:"52.90627963758573, 4.9610812118765395",description:"\u003Cp\u003EIs het je al opgevallen dat veel inwoners in&nbsp;Hippolytushoef&nbsp;trendy beenmode dragen? Er is een logische verklaring daarvoor; midden in het gezellige centrum kun je namelijk Sstyle Beenmode vinden. En hier vind je de&nbsp;mooiste merken in beenmode.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVan&nbsp;Calvin Klein&nbsp;sokken, tot&nbsp;Oroblu&nbsp;legwear, van draagbare&nbsp;Babouche&nbsp;boots tot goede billen in&nbsp;Muchachomalo's. Sstyle heeft het gegarandeerd. Leuk voor jezelf, maar misschien zelfs nóg leuker om cadeau te doen (tip: wij hebben ook&nbsp;cadeaubonnen). Tot snel!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EHave you noticed that many residents in Hippolytushoef wear trendy legwear? There is a logical explanation for this; In the middle of the cozy center you can find Sstyle Beenmode. And here you will find the most beautiful brands in legwear.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EFrom Calvin Klein socks, to Oroblu legwear, from wearable Babouche boots to good buttocks in Muchachomalo's. Sstyle has it guaranteed. Nice for yourself, but maybe even more fun to give as a gift (tip: we also have gift vouchers). See you soon!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EIst Ihnen aufgefallen, dass viele Bewohner von Hippolytushoef trendige Beinkleider tragen? Dafür gibt es eine logische Erklärung; Mitten im gemütlichen Zentrum finden Sie Sstyle Beenmode. Und hier finden Sie die schönsten Marken der Legwear.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVon Calvin-Klein-Socken bis hin zu Beinbekleidung von Oroblu, von tragbaren Babouche-Stiefeln bis hin zu guten Pobacken im Muchachomalo's. Sstyle hat es garantiert. Schön für sich selbst, aber vielleicht noch mehr Spaß beim Verschenken (Tipp: Wir haben auch Geschenkgutscheine). Bis bald!\u003C\u002Fp\u003E",phone:"0657107994",site:"https:\u002F\u002Fsstyle.nl\u002F",enabled:a},{id:"62ee3caab974cb2998dd10fc",name:"Installatiebedrijf S.Smit",category:b,coordinates:"52.90536520868946, 4.957002015884866",description:"\u003Cp\u003EAl meer dan 50 jaar is S. Smit installatietechniek een begrip op Wieringen en in de omgeving. Van een ambachtelijk bedrijfje is het uitgegroeid tot een modern en flexibel bedrijf. Persoonlijke aandacht en betrokkenheid bij iedere opdracht vinden wij erg belangrijk; graag worden wij uitgedaagd een oplossing te bedenken voor uw specifieke wens. En dat willen we graag zo houden.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EIn de loop der jaren hebben we de vele ontwikkelingen op het vakgebied op de voet gevolgd; zodat we buiten het reguliere installatiewerk ook ervaren en volkomen ‘up to date’ zijn op het gebied van luchtbehandeling, zonne-energiesystemen, energiezuinige lage-temperatuur-vloerverwarming én vloerkoeling, hout-cv installaties en&nbsp;warmtepompen. Ook een combinatie van bijvoorbeeld een zon-thermische en hout-cv-installatie, al dan niet uitgebreid met een buffervat&nbsp;is mogelijk. De mogelijkheden zijn eigenlijk onbeperkt; niet alleen in de particuliere sector, maar ook in de horeca en utiliteit.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-e1363259197105.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme_accent);\"\u003E\u003Cimg src=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-300x199.jpg\" alt=\"Bedrijfspand aan de Beltstraat\" height=\"199\" width=\"300\"\u003E\u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003Cp\u003EBedrijfspand aan de Beltstraat\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ES. Smit installation technology has been a household name on Wieringen and in the surrounding area for more than 50 years. From a traditional company it has grown into a modern and flexible company. Personal attention and involvement in every assignment is very important to us; we like to be challenged to come up with a solution for your specific wishes. And we would like to keep it that way.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EOver the years we have closely followed the many developments in the field; so that, outside the regular installation work, we are also experienced and completely 'up to date' in the field of air treatment, solar energy systems, energy-efficient low-temperature floor heating and floor cooling, wood central heating installations and heat pumps. A combination of, for example, a solar thermal and wood central heating system, whether or not extended with a buffer tank, is also possible. The possibilities are actually limitless; not only in the private sector, but also in the hospitality and utility sectors.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-e1363259197105.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme_accent); background-color: rgb(13, 7, 53);\"\u003E\u003Cimg src=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-300x199.jpg\" alt=\"Bedrijfspand aan de Beltstraat\" height=\"199\" width=\"300\"\u003E\u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003Cp\u003EBusiness premises on Beltstraat\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ES. Smit Installationstechnik ist seit mehr als 50 Jahren ein Begriff auf Wieringen und Umgebung. Aus einem Traditionsunternehmen ist ein modernes und flexibles Unternehmen geworden. Persönliche Aufmerksamkeit und Engagement bei jedem Auftrag ist uns sehr wichtig; Wir lassen uns gerne herausfordern, um eine Lösung für Ihre speziellen Wünsche zu finden. Und das möchten wir gerne beibehalten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EIm Laufe der Jahre haben wir die vielen Entwicklungen auf diesem Gebiet genau verfolgt; sodass wir auch außerhalb der regulären Installationsarbeiten in den Bereichen Luftaufbereitung, Solaranlagen, energieeffiziente Niedertemperatur-Fußbodenheizungen und -kühlungen, Holzzentralheizungen und Wärmepumpen erfahren und absolut „up to date“ sind . Auch eine Kombination aus z. B. Solarthermie und Holzzentralheizung mit oder ohne Pufferspeichererweiterung ist möglich. Die Möglichkeiten sind eigentlich grenzenlos; nicht nur in der Privatwirtschaft, sondern auch im Gastgewerbe und Versorgungssektor.\u003C\u002Fp\u003E\u003Cp\u003E\u003Ca href=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-e1363259197105.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: var(--theme_accent); background-color: rgb(13, 7, 53);\"\u003E\u003Cimg src=\"https:\u002F\u002Fssmit.nl\u002Fwp-content\u002Fuploads\u002F2012\u002F06\u002F06122139-300x199.jpg\" alt=\"Bedrijfspand aan de Beltstraat\" height=\"199\" width=\"300\"\u003E\u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003Cp\u003EGeschäftsräume in der Beltstraat\u003C\u002Fp\u003E",email:"info@ssmit.nl",phone:"0227591316",site:"https:\u002F\u002Fssmit.nl\u002F",enabled:a},{id:"62ee3d1db974cb2998dd10fd",name:"Stoer Mode",category:b,coordinates:"52.90632055949511, 4.961049877817161",description:"\u003Cp\u003EStoere mode voor jong en oud!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ECool fashion for young and old!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ECoole Mode für Jung und Alt!\u003C\u002Fp\u003E",email:"stoermode@hotmail.com",phone:"0648612837",site:"https:\u002F\u002Fwww.facebook.com\u002FStoerModeHippo\u002F",enabled:a},{id:"62ee3da4b974cb2998dd10fe",name:"Studio Marlies",category:b,coordinates:"52.907158920534584, 4.961384395663431",description:"\u003Cp\u003EHaarstylist &amp; visagist\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EHairstylist &amp; makeup artist\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EHairstylistin und Maskenbildnerin\u003C\u002Fp\u003E",email:"studiomarlies@ziggo.nl",phone:"0683211912",site:"https:\u002F\u002Fwww.instagram.com\u002FStudioMarlies\u002F",enabled:a},{id:"62ee3e19b974cb2998dd10ff",name:"Dierenspeciaalzaak 't Warme Nest",category:b,coordinates:"52.90776578333325, 4.962152369230831",description:"\u003Cp\u003EDierenspeciaalzaak 't Warme Nest is een veelzijdige en betrokken dierenspeciaalzaak gespecialiseerd in honden en katten. Bij ons kunt u terecht voor eerlijk advies. In de winkel beschikken wij over een zeer ruim assortiment producten voor honden en katten.\u003C\u002Fp\u003E\u003Cp\u003EIn onze webshop vind u daarvan een groot gedeelte terug.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EPet store 't Warme Nest is a versatile and committed pet store specialized in dogs and cats. You can contact us for honest advice. In the store we have a very wide range of products for dogs and cats.\u003C\u002Fp\u003E\u003Cp\u003EYou will find a large part of this in our webshop.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ETierhandlung 't Warme Nest ist eine vielseitige und engagierte Tierhandlung, die sich auf Hunde und Katzen spezialisiert hat. Sie können uns für eine ehrliche Beratung kontaktieren. Im Geschäft haben wir eine sehr große Auswahl an Produkten für Hunde und Katzen.\u003C\u002Fp\u003E\u003Cp\u003EEinen großen Teil davon finden Sie in unserem Webshop.\u003C\u002Fp\u003E",email:"info@warmenest.nl",phone:"0227595211",site:"https:\u002F\u002Fwww.warmenest.nl\u002F",enabled:a},{id:"62ee3e83b974cb2998dd1100",name:"Tutto Woonstijl",category:b,coordinates:"52.90777752734256, 4.962278369362164",description:"\u003Cp\u003EVloeren, Raamdecoratie, Wandbekleding, meubels en interieuradvies op maat\u003C\u002Fp\u003E\u003Cp\u003ETutto per la tua casa !\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EFloors, Window decoration, Wall coverings, furniture and tailor-made interior advice\u003C\u002Fp\u003E\u003Cp\u003ETutto per la tua casa!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EFußböden, Fensterdekoration, Wandverkleidungen, Möbel und maßgeschneiderte Einrichtungsberatung\u003C\u002Fp\u003E\u003Cp\u003ETutto per la tua casa!\u003C\u002Fp\u003E",email:"info@tuttowoonstijl.nl",phone:"0621328303",site:"http:\u002F\u002Fwww.tuttowoonstijl.nl\u002F",enabled:a},{id:"62ee3f24b974cb2998dd1101",name:"Ukkie Shop",category:b,coordinates:"52.90625954332816, 4.961002868973696",description:"\u003Cp\u003EDe naam Ukkie Shop vertegenwoordigt niet het uitgebreide assortiment van de winkel. Bij de naam Ukkie Shop denkt u aan een babywinkel. In 2007 zijn wij inderdaad gestart als babykadowinkel met maar 30 m2. Sinds 2017 zijn wij verhuisd naar een pand met ruim 300m2. Het baby assortiment is inmiddels uitgegroeid tot een klein warenhuis. Een soort “winkel van sinkel” waar NEE niet te koop is.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWij staan bekend om onze unieke kraampakketten, groot assortiment , service, creativiteit, bereidwilligheid en vriendelijkheid. Het is een feestje om onze winkel te bezoeken. U wordt vriendelijk en gastvrij ontvangen. Klant is koning. Kom gerust een keer kijken en laat u verrassen door ons grote aanbod. En is het artikel wat u zoekt er niet? Dan doen wij onze uiterste best om het voor u te regelen.\u003C\u002Fp\u003E\u003Cp\u003EIeder cadeau krijgt speciale aandacht! Wij staan garant voor een verzorgd en keurig ingepakte cadeautje. Heeft u persoonlijke wensen? Laat het ons weten, er is veel mogelijk!\u003C\u002Fp\u003E\u003Cp\u003EKom eens bij ons langs. Of snuffel in de webwinkel. Ik moet u wel bekennen dat deze niet altijd helemaal up to date is. Dagelijks komen er artikelen binnen, we doen ons best zoveel mogelijk op de site te plaatsen en te vernieuwen maar het ontbreekt ons wel eens aan tijd. Sorry daarvoor. Uiteraard wordt alles altijd netjes afgehandeld en geregeld.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe name Ukkie Shop does not represent the extensive range of the store. When you think of the name Ukkie Shop, you think of a baby store. In 2007 we indeed started as a baby gift shop with only 30 m2. Since 2017 we have moved to a building with more than 300m2. The baby range has now grown into a small department store. A kind of \"sinkel shop\" where NO is not for sale.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWe are known for our unique maternity packages, wide range, service, creativity, willingness and friendliness. It is a pleasure to visit our store. You will be welcomed in a friendly and hospitable manner. Customer is king. Come and have a look and be surprised by our wide range. And is the article you are looking for not there? Then we will do our utmost to arrange it for you.\u003C\u002Fp\u003E\u003Cp\u003EEvery gift gets special attention! We guarantee a neat and neatly wrapped gift. Do you have personal wishes? Let us know, a lot is possible!\u003C\u002Fp\u003E\u003Cp\u003ECome and visit us. Or browse the web store. I must confess that it is not always completely up to date. Articles come in every day, we do our best to place and update as much as possible on the site, but we sometimes lack time. Sorry about that. Of course everything is always neatly handled and arranged.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Name Ukkie Shop repräsentiert nicht das umfangreiche Sortiment des Ladens. Wenn Sie an den Namen Ukkie Shop denken, denken Sie an einen Babyladen. 2007 haben wir tatsächlich als Baby-Geschenkeladen mit nur 30 m2 angefangen. Seit 2017 sind wir in ein Gebäude mit mehr als 300m2 umgezogen. Aus dem Babysortiment ist inzwischen ein kleines Kaufhaus geworden. Eine Art „Sinkelladen“, in dem es NO nicht zu kaufen gibt.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EWir sind bekannt für unsere einzigartigen Mutterschaftspakete, breites Angebot, Service, Kreativität, Bereitschaft und Freundlichkeit. Es ist eine Freude, unseren Laden zu besuchen. Sie werden freundlich und gastfreundlich empfangen. Der Kunde ist König. Schauen Sie vorbei und lassen Sie sich von unserem breiten Angebot überraschen. Und ist der gesuchte Artikel nicht dabei? Dann werden wir unser Möglichstes tun, um es für Sie zu arrangieren.\u003C\u002Fp\u003E\u003Cp\u003EJedes Geschenk bekommt besondere Aufmerksamkeit! Wir garantieren ein ordentlich und ordentlich verpacktes Geschenk. Sie haben persönliche Wünsche? Lassen Sie es uns wissen, vieles ist möglich!\u003C\u002Fp\u003E\u003Cp\u003EKomm und besuche uns. Oder stöbern Sie im Webshop. Ich muss gestehen, dass es nicht immer ganz aktuell ist. Artikel kommen jeden Tag, wir tun unser Bestes, um so viel wie möglich auf der Seite zu platzieren und zu aktualisieren, aber manchmal fehlt uns die Zeit. Das tut mir leid. Natürlich ist alles immer ordentlich gehandhabt und geordnet.\u003C\u002Fp\u003E",email:"info@babykadowinkelukkieshop.nl",phone:"0227591485",site:"http:\u002F\u002Fwww.babykadowinkelukkieshop.nl\u002F",enabled:a},{id:"62ee3f97b974cb2998dd1102",name:"Uit Eigen Streek Delicatessen",category:b,coordinates:"52.90777989095442, 4.962274866991479",description:"\u003Cp\u003EUit Eigen Streek Delicatessen en Cadeaus is gevestigd&nbsp;voorin de Tutto Concept Store aan het Kerkplein 23 in Hippolytushoef. Let op!&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EOok op de Weekmarkt in Schagen op donderdagochtend en op de Zee Verse Vismarkt in Den Oever elke zaterdagochtend, heeft Uit Eigen Streek een vaste plek.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EUit Eigen Streek Delicatessen and Gifts is located in the front of the Tutto Concept Store at Kerkplein 23 in Hippolytushoef. NB!\u003C\u002Fp\u003E\u003Cp\u003EUit Eigen Streek also has a permanent place at the Weekmarkt in Schagen on Thursday mornings and at the Zee Verse Vismarkt in Den Oever every Saturday morning.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUit Eigen Streek Delicatessen and Gifts befindet sich vor dem Tutto Concept Store am Kerkplein 23 in Hippolytushoef. Achtung!\u003C\u002Fp\u003E\u003Cp\u003EUit Eigen Streek hat außerdem jeden Donnerstagmorgen einen festen Platz auf dem Wochenmarkt in Schagen und jeden Samstagmorgen auf dem Zee Verse Vismarkt in Den Oever.\u003C\u002Fp\u003E",email:"info@uiteigenstreek.nl",phone:"0620010072",site:"http:\u002F\u002Fwww.uiteigenstreek.nl\u002F",enabled:a},{id:"62ee401eb974cb2998dd1103",name:"Van Dijk Optiek",category:b,coordinates:"52.906506911523145, 4.961122880324851",description:"\u003Cp\u003EVan Dijk Optiek is in Julianadorp al sinds 1992 gevestigd in Winkelcentrum Dorperweerth. We zijn inmiddels uitgegroeid tot dé specialist voor Julianadorp en omstreken op het gebied van brillen en lenzen. Onder leiding van opticien Ricardo Hertzberger staat een deskundig en enthousiast team klaar om u van dienst te zijn.\u003C\u002Fp\u003E\u003Cp\u003EBij Van Dijk Optiek treft u een breed assortiment van brillen, zonnebrillen en lenzen aan. Naast een moderne uitstraling staan oogzorg en service hoog in het vaandel. Van Dijk Optiek is aangesloten bij een inkooporganisatie van meer dan 350 opticiens. Dit zorgt ervoor dat naast kwaliteit en service ook de prijs aantrekkelijk blijft. Alle oogmetingen en lensaanpassingen worden gedaan door een ANVC gecertificeerde contactlensspecialist cq, gediplomeerde vakbekwame opticien.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EVan Dijk Optiek has been located in the Dorperweerth Shopping Center in Julianadorp since 1992. We have now grown into the specialist for Julianadorp and the surrounding area in the field of glasses and lenses. Led by optician Ricardo Hertzberger, an expert and enthusiastic team is ready to serve you.\u003C\u002Fp\u003E\u003Cp\u003EAt Van Dijk Optics you will find a wide range of glasses, sunglasses and lenses. In addition to a modern look, eye care and service are of paramount importance. Van Dijk Optiek is affiliated with a purchasing organization of more than 350 opticians. This ensures that, in addition to quality and service, the price also remains attractive. All eye measurements and lens adjustments are done by an ANVC certified contact lens specialist or qualified optician.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EVan Dijk Optiek befindet sich seit 1992 im Einkaufszentrum Dorperweerth in Julianadorp. Mittlerweile sind wir zum Spezialisten für Julianadorp und Umgebung im Bereich Brillen und Linsen gewachsen. Unter der Leitung von Optiker Ricardo Hertzberger steht Ihnen ein kompetentes und enthusiastisches Team zur Verfügung.\u003C\u002Fp\u003E\u003Cp\u003EBei Van Dijk Optics finden Sie eine große Auswahl an Brillen, Sonnenbrillen und Linsen. Neben einem modernen Look sind Augenpflege und Service von größter Bedeutung. Van Dijk Optiek ist einer Einkaufsorganisation von mehr als 350 Optikern angeschlossen. So bleibt neben Qualität und Service auch der Preis attraktiv. Alle Augenmessungen und Linsenanpassungen werden von einem ANVC-zertifizierten Kontaktlinsenspezialisten oder einem qualifizierten Optiker durchgeführt.\u003C\u002Fp\u003E",email:"info@vandijkoptiekjulianadorp.nl",phone:"0227591057",site:"http:\u002F\u002Fwww.vandijkoptiekjulianadorp.nl\u002F",enabled:a},{id:"65381fb59b1f7ffbe34b2d1f",name:"Hubo bouwmarkt Anna Paulowna",category:b,coordinates:"52.859043625661975, 4.832294896299486",description:"\u003Cp\u003EWelkom bij Hubo Anna Paulowna. Bij ons stap je binnen voor al je klusbenodigdheden. Met ons grote assortiment aan doe-het-zelf artikelen vind je altijd wat je nodig hebt.\u003C\u002Fp\u003E",email:"annapaulowna@hubo.nl",phone:"0223531427",site:"https:\u002F\u002Fwww.hubo.nl\u002Fanna-paulowna",sponsor_walking_wieringen:a,invisible:a,enabled:a}],routes:[{id:"64b9a29d4b72a00df704c8f8",startPoint:f,name:"Haven Route",description:"\u003Cp\u003EMaak een onvergetelijke wandeling langs de schilderachtige haven van Den Oever op het prachtige Wieringen. Deze betoverende route biedt een unieke ervaring waarbij je kunt genieten van het bruisende maritieme leven en de natuurlijke schoonheid van de omgeving. Wandel langs de kades en bewonder de kleurrijke vissersboten die rustig dobberen op het water. De haven van Den Oever is ook een ideale plek om verse vis te proeven en te genieten van de lokale gastronomie. Onderweg kom je langs gezellige restaurants en cafés met uitzicht op het water. De wandeling biedt tevens prachtige vergezichten over het Waddenzee-landschap. Ontdek de charme van de haven van Den Oever tijdens deze onvergetelijke wandeling op Wieringen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an unforgettable walk along the picturesque harbor of Den Oever on the beautiful island of Wieringen. This enchanting route offers a unique experience where you can enjoy the bustling maritime life and the natural beauty of the surroundings. Stroll along the quays and admire the colorful fishing boats peacefully bobbing on the water. The harbor of Den Oever is also an ideal place to taste fresh fish and savor the local cuisine. Along the way, you'll pass cozy restaurants and cafes with waterfront views. The walk also provides beautiful panoramas of the Wadden Sea landscape. Discover the charm of the harbor of Den Oever during this unforgettable hike on Wieringen.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMachen Sie einen unvergesslichen Spaziergang entlang des malerischen Hafens von Den Oever auf der schönen Insel Wieringen. Diese bezaubernde Route bietet ein einzigartiges Erlebnis, bei dem Sie das geschäftige maritime Leben und die natürliche Schönheit der Umgebung genießen können. Schlendern Sie entlang der Kais und bewundern Sie die farbenfrohen Fischerboote, die friedlich auf dem Wasser schaukeln. Der Hafen von Den Oever ist auch ein idealer Ort, um frischen Fisch zu kosten und die lokale Küche zu genießen. Unterwegs passieren Sie gemütliche Restaurants und Cafés mit Blick auf das Wasser. Der Spaziergang bietet auch wunderschöne Panoramen der Landschaft der Wattenmeer-Region. Entdecken Sie den Charme des Hafens von Den Oever während dieser unvergesslichen Wanderung auf Wieringen.\u003C\u002Fp\u003E",file:"haven",km:"4.5",image:"haven.jpg",url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Fhavenroute-rood\u002F56403",isWalk:a,startingPointId:e},{id:"64b9a3a34b72a00df704c8fa",startPoint:d,name:"Westerklief Route",description:"\u003Cp\u003EMaak een adembenemende wandeling over Westerklief, een bijzondere locatie op het betoverende Wieringen. Deze route biedt wandelaars een unieke kans om te genieten van het schilderachtige landschap en de rijke geschiedenis van de regio. Een van de hoogtepunten van de wandeling is de imposante Zwerfkei, een indrukwekkende zwerfsteen die eeuwen geleden door gletsjers is achtergelaten. Bewonder de prachtige natuurlijke omgeving terwijl je je een weg baant over kronkelende paden en door pittoreske dorpjes. Westerklief heeft ook een rijke archeologische geschiedenis, en tijdens je wandeling kun je genieten van de mysterieuze sfeer die dit gebied omgeeft. Mis deze unieke wandelervaring over Westerklief op Wieringen niet!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on a breathtaking walk over Westerklief, a unique location on the enchanting island of Wieringen. This route offers hikers a unique opportunity to enjoy the picturesque landscape and rich history of the region. One of the highlights of the walk is the impressive Zwerfkei, an imposing glacial erratic left behind by glaciers centuries ago. Admire the beautiful natural surroundings as you make your way through winding paths and picturesque villages. Westerklief also has a rich archaeological history, and during your walk, you can immerse yourself in the mysterious atmosphere that surrounds this area. Don't miss this unique hiking experience over Westerklief on Wieringen!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUnternehmen Sie einen atemberaubenden Spaziergang über Westerklief, einen einzigartigen Ort auf der zauberhaften Insel Wieringen. Diese Route bietet Wanderern eine einzigartige Gelegenheit, die malerische Landschaft und die reiche Geschichte der Region zu genießen. Einer der Höhepunkte des Spaziergangs ist die beeindruckende Zwerfkei, ein imposanter Findling, der vor Jahrhunderten von Gletschern zurückgelassen wurde. Bewundern Sie die wunderschöne Naturumgebung, während Sie sich Ihren Weg durch verwinkelte Pfade und malerische Dörfer bahnen. Westerklief hat auch eine reiche archäologische Geschichte, und während Ihres Spaziergangs können Sie in die geheimnisvolle Atmosphäre eintauchen, die dieses Gebiet umgibt. Verpassen Sie nicht dieses einzigartige Wandererlebnis über Westerklief auf Wieringen!\u003C\u002Fp\u003E",file:"westerklief",km:"4.7",image:"westerklief.jpeg",isBike:h,isWalk:a,startingPointId:c},{id:"64b99fd54b72a00df704c8f3",startPoint:d,name:"Wierdijk Route",description:"\u003Cp\u003EMaak een onvergetelijke wandeling over de Wierdijk op het prachtige Wieringen. Deze schilderachtige route biedt een unieke ervaring waarbij je kunt genieten van adembenemende uitzichten over de Waddenzee en het omliggende landschap. De Wierdijk, een historisch dijksysteem dat ooit cruciaal was voor de bescherming tegen de zee, is nu een geliefde plek voor wandelaars en natuurliefhebbers. Langs de dijk kom je langs charmante dorpjes en oude molens, die een glimp bieden van het rijke verleden van deze regio. Ontdek de geschiedenis, cultuur en natuur tijdens deze bijzondere wandeling over de Wierdijk.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an unforgettable walk along the Wierdijk on the beautiful island of Wieringen. This picturesque route offers a unique experience where you can enjoy breathtaking views of the Wadden Sea and the surrounding landscape. The Wierdijk, a historical dike system that was once crucial for protecting against the sea, is now a beloved spot for hikers and nature enthusiasts. Along the dike, you'll pass charming villages and ancient windmills, offering a glimpse into the rich heritage of this region. Discover history, culture, and nature during this extraordinary walk along the Wierdijk.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUnternehmen Sie einen unvergesslichen Spaziergang entlang der Wierdijk auf der schönen Insel Wieringen. Diese malerische Route bietet ein einzigartiges Erlebnis, bei dem Sie atemberaubende Ausblicke auf das Wattenmeer und die umliegende Landschaft genießen können. Die Wierdijk, ein historisches Deichsystem, das einst entscheidend für den Schutz vor der Nordsee war, ist heute ein beliebter Ort für Wanderer und Naturliebhaber. Entlang des Deiches passieren Sie charmante Dörfer und alte Windmühlen, die einen Einblick in das reiche Erbe dieser Region bieten. Entdecken Sie Geschichte, Kultur und Natur während dieses außergewöhnlichen Spaziergangs entlang der Wierdijk.\u003C\u002Fp\u003E",file:"wierdijk",km:"7",image:"wierdijk.jpg",isBike:h,isWalk:a,startingPointId:c},{id:"64b99f174b72a00df704c8f1",startPoint:d,name:i,description:j,description_en:k,description_de:l,file:"stroe-bike",km:"8",image:m,isBike:a,startingPointId:c},{id:"64b99f534b72a00df704c8f2",startPoint:d,name:i,description:j,description_en:k,description_de:l,file:"stroe",km:"8.3",image:m,isWalk:a,startingPointId:c},{id:"64b9a1c04b72a00df704c8f6",startPoint:f,name:"Oosterland Route",description:"\u003Cp\u003EMaak een betoverende wandeling door het pittoreske Oosterland op het charmante Wieringen. Deze unieke route biedt wandelaars de mogelijkheid om te genieten van de rustige schoonheid van het platteland en de rijke geschiedenis van dit gebied. Onderweg kom je langs historische boerderijen, schilderachtige landweggetjes en traditionele Nederlandse windmolens die het landschap sieren. Oosterland staat bekend om zijn authentieke sfeer en cultureel erfgoed. Bewonder de idyllische omgeving en geniet van de landelijke rust tijdens deze onvergetelijke wandeling. Verken de verborgen pareltjes van Oosterland op Wieringen en laat je verrassen door de charme van dit historische dorp.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an enchanting walk through the picturesque Oosterland on the charming island of Wieringen. This unique route offers hikers the opportunity to enjoy the tranquil beauty of the countryside and the rich history of this area. Along the way, you'll pass historical farms, scenic country lanes, and traditional Dutch windmills that adorn the landscape. Oosterland is known for its authentic atmosphere and cultural heritage. Admire the idyllic surroundings and savor the rural tranquility during this unforgettable hike. Explore the hidden gems of Oosterland on Wieringen and be amazed by the charm of this historic village.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUnternehmen Sie einen bezaubernden Spaziergang durch das malerische Oosterland auf der charmanten Insel Wieringen. Diese einzigartige Route bietet Wanderern die Möglichkeit, die ruhige Schönheit der Landschaft und die reiche Geschichte dieser Region zu genießen. Unterwegs passieren Sie historische Bauernhöfe, malerische Landstraßen und traditionelle holländische Windmühlen, die die Landschaft schmücken. Oosterland ist bekannt für seine authentische Atmosphäre und sein kulturelles Erbe. Bewundern Sie die idyllische Umgebung und genießen Sie die ländliche Ruhe während dieser unvergesslichen Wanderung. Entdecken Sie die versteckten Schätze von Oosterland auf Wieringen und lassen Sie sich von dem Charme dieses historischen Dorfes verzaubern.\u003C\u002Fp\u003E",file:"oosterland",km:"9.7",image:"oosterland.jpg",url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Foosterlandroute-blauw\u002F56405",isBike:a,isWalk:a,startingPointId:e},{id:"64b9a3034b72a00df704c8f9",startPoint:d,name:"Quarantaine Route",description:"\u003Cp\u003EMaak een fascinerende wandeling langs de Quarantaine Weg op het prachtige Wieringen en ontdek de geschiedenis en unieke bezienswaardigheden. De Quarantaine Weg, ooit gebruikt als route voor het isoleren van zieke zeelieden, biedt tegenwoordig een schilderachtige wandelervaring. Tijdens deze route kom je langs historische gebouwen, zoals het voormalige quarantainegebouw en andere overblijfselen uit het verleden. Geniet van de rustige omgeving, het weidse uitzicht over het landschap en de sfeer van vervlogen tijden. De wandeling op de Quarantaine Weg is een reis door het rijke maritieme verleden van Wieringen die je niet wilt missen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on a fascinating walk along the Quarantine Road on the beautiful island of Wieringen and discover its history and unique landmarks. The Quarantine Road, once used as a route to isolate sick sailors, now offers a picturesque hiking experience. Along this route, you'll pass historical buildings, such as the former quarantine station and other remnants of the past. Enjoy the peaceful surroundings, the expansive views of the landscape, and the ambiance of bygone times. The walk on the Quarantine Road is a journey through Wieringen's rich maritime history that you don't want to miss.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMachen Sie einen faszinierenden Spaziergang entlang der Quarantaine Straße auf der schönen Insel Wieringen und entdecken Sie ihre Geschichte und einzigartige Sehenswürdigkeiten. Die Quarantaine Straße, einst als Route zur Isolierung kranker Seeleute genutzt, bietet heute ein malerisches Wandererlebnis. Entlang dieser Route passieren Sie historische Gebäude wie die ehemalige Quarantänestation und andere Überreste der Vergangenheit. Genießen Sie die ruhige Umgebung, den weiten Blick über die Landschaft und das Ambiente vergangener Zeiten. Der Spaziergang auf der Quarantaine Straße ist eine Reise durch die reiche maritime Geschichte von Wieringen, die Sie nicht verpassen sollten.\u003C\u002Fp\u003E",file:"quarantaine",km:"12",image:"quarantaine.jpg",isBike:a,startingPointId:c},{id:"64c2d4d7313e32c40a7d3a98",startPoint:f,name:"Gat in de dijk -route",description:"\u003Cp\u003EDeze prachtige fietsroute begint in het pittoreske Den Oever en voert je door het betoverende Robbenoordbos om uiteindelijk bij Het Gat in de Dijk te eindigen. Onderweg fiets je langs schilderachtige landschappen, historische plekken en natuurlijke schoonheid. Het Gat in de Dijk heeft een bijzondere betekenis vanwege de gebeurtenissen tijdens de Tweede Wereldoorlog, waarbij de dijk werd opgeblazen en de Wieringermeer onder water kwam te staan. Nu is dit gebied omgetoverd tot natuurgebied 'De Wielen' met de restanten van een boerderij die hier vroeger stond. Op de oude dijk vind je een toegangspad met een uitkijkpunt, waar je een prachtig uitzicht hebt op het water met daarop de fundering van de voormalige boerderij.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThis beautiful cycling route starts in the picturesque town of Den Oever and takes you through the enchanting Robbenoord Forest, culminating at Het Gat in de Dijk (The Hole in the Dike). Along the way, you'll pass by scenic landscapes, historic sites, and natural beauty. Het Gat in de Dijk holds a special significance due to the events during World War II when the dike was blown up, causing the Wieringermeer to flood. Today, this area has transformed into a nature reserve called 'De Wielen,' with the remnants of a farmhouse that once stood there. On the old dike, a pathway leads to an observation point where you can enjoy a splendid view of the water, showcasing the foundation of the former farmhouse.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDiese wunderschöne Fahrradroute beginnt im malerischen Den Oever und führt durch den bezaubernden Robbenoordbos, um schließlich am Het Gat in de Dijk (Das Loch im Deich) zu enden. Unterwegs passieren Sie malerische Landschaften, historische Stätten und natürliche Schönheit. Het Gat in de Dijk hat eine besondere Bedeutung aufgrund der Ereignisse während des Zweiten Weltkriegs, als der Deich gesprengt wurde und das Wieringermeer überflutet wurde. Heute ist dieses Gebiet zu einem Naturreservat namens 'De Wielen' geworden, mit den Überresten eines Bauernhauses, das einst hier stand. Auf dem alten Deich führt ein Weg zu einem Aussichtspunkt, von dem aus Sie einen herrlichen Blick auf das Wasser haben und die Grundmauern des ehemaligen Bauernhauses sehen können.\u003C\u002Fp\u003E",file:"gatindedijk",km:"14",image:"gatindedijk.jpg",isBike:a,startingPointId:e},{id:"64b9a0bc4b72a00df704c8f4",startPoint:d,name:"Amstelmeer Route",description:"\u003Cp\u003E\u003Cspan style=\"color: rgba(255, 255, 255, 0.7);\"\u003EMaak een betoverende wandeling rond het schilderachtige Amstelmeer, gelegen naast het eiland Wieringen. Deze adembenemende route biedt wandelaars een unieke gelegenheid om te genieten van de serene schoonheid van het meer en het omliggende landschap. Tijdens de wandeling ontdek je de diverse flora en fauna van dit natuurgebied en kun je genieten van prachtige uitzichten over het water. Langs het Amstelmeer zijn er ook interessante bezienswaardigheden, zoals historische dijken en pittoreske dorpjes, die je een kijkje geven in het rijke verleden van deze regio. Laat je betoveren door de natuurlijke pracht en historische charme tijdens deze wandeling rond het Amstelmeer naast Wieringen.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an enchanting walk around the picturesque Amstelmeer, located next to the island of Wieringen. This breathtaking route offers hikers a unique opportunity to enjoy the serene beauty of the lake and the surrounding landscape. During the walk, you'll discover the diverse flora and fauna of this nature reserve and indulge in stunning views over the water. Along the Amstelmeer, there are also interesting landmarks such as historical dikes and picturesque villages, providing a glimpse into the rich history of this region. Let yourself be captivated by the natural beauty and historical charm during this walk around the Amstelmeer next to Wieringen.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMachen Sie einen bezaubernden Spaziergang rund um das malerische Amstelmeer, das neben der Insel Wieringen liegt. Diese atemberaubende Route bietet Wanderern eine einzigartige Gelegenheit, die ruhige Schönheit des Sees und der umliegenden Landschaft zu genießen. Während des Spaziergangs entdecken Sie die vielfältige Flora und Fauna dieses Naturschutzgebiets und können atemberaubende Ausblicke über das Wasser genießen. Entlang des Amstelmeers gibt es auch interessante Sehenswürdigkeiten wie historische Deiche und malerische Dörfer, die einen Einblick in die reiche Geschichte dieser Region bieten. Lassen Sie sich von der natürlichen Schönheit und dem historischen Charme bei diesem Spaziergang rund um das Amstelmeer neben Wieringen verzaubern.\u003C\u002Fp\u003E",file:"amstelmeer",km:"22",image:"amstelmeer.jpg",isBike:a,isWalk:a,startingPointId:c},{id:"64b9a2334b72a00df704c8f7",startPoint:f,name:"Willibrord Route",description:"\u003Cp\u003EStap in de voetsporen van de heilige Willibrord en maak een betoverende pelgrimswandeling op het prachtige Wieringen. Rond het jaar 700 werd op Stroe, een idyllisch buurtschap op Wieringen, een kerkje gebouwd, vermoedelijk door de heilige Willibrord zelf. Na verloop van tijd werd het houten kerkje vervangen door een gebouw van tufsteen, waarin een gevelsteen met de afbeelding van een varken, een heidens symbool, te vinden was. In 2016 is de Heidense Kapel op Stroe herbouwd en vormt nu een rustpunt voor pelgrims om even bij te komen en een stempel in hun wandelboekje te zetten. Deze pelgrimswandeling biedt niet alleen een unieke historische ervaring maar ook prachtige landschappen en charmante dorpen die de heilige Willibrord ooit heeft doorkruist.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EWalk in the footsteps of Saint Willibrord and embark on an enchanting pilgrimage on the beautiful island of Wieringen. Around the year 700, a small church was built in Stroe, an idyllic hamlet on Wieringen, believed to have been constructed by Saint Willibrord himself. Over time, the wooden church was replaced by a tuff stone building with a gable stone depicting a pig, a symbol of pagan origin. In 2016, the Heidense Kapel (Heathen Chapel) in Stroe was reconstructed, now serving as a resting point for pilgrims to take a break and stamp their pilgrimage booklets. This pilgrimage walk not only offers a unique historical experience but also showcases beautiful landscapes and charming villages that Saint Willibrord once traversed.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EFolgen Sie den Fußspuren des heiligen Willibrord und begeben Sie sich auf eine zauberhafte Pilgerwanderung auf der schönen Insel Wieringen. Um das Jahr 700 wurde in Stroe, einem idyllischen Weiler auf Wieringen, eine kleine Kirche erbaut, die vermutlich vom heiligen Willibrord persönlich errichtet wurde. Im Laufe der Zeit wurde die hölzerne Kirche durch ein Gebäude aus Tuffstein ersetzt, in dem sich ein Giebelstein mit der Abbildung eines Schweins, einem Symbol heidnischer Herkunft, befand. Im Jahr 2016 wurde die Heidense Kapel (Heidentempel) in Stroe wiederaufgebaut und dient nun als Ruhepunkt für Pilger, um eine Pause einzulegen und ihre Pilgerbücher zu stempeln. Diese Pilgerwanderung bietet nicht nur ein einzigartiges historisches Erlebnis, sondern zeigt auch wunderschöne Landschaften und charmante Dörfer, die der heilige Willibrord einst durchquerte.\u003C\u002Fp\u003E",file:"willibrord",km:"26.8",image:n,url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Fin-het-voetspoor-van-de-heilige-willibrord\u002F83791",isWalk:a,startingPointId:e},{id:"64b9a1384b72a00df704c8f5",startPoint:d,name:"Wieringen Route",description:"\u003Cp\u003EBeleef een magische wandeling rondom het voormalige eiland Wieringen en ontdek de rijke geschiedenis en adembenemende bezienswaardigheden. Deze betoverende route neemt je mee op een reis door de tijd terwijl je geniet van het prachtige landschap en de natuurlijke schoonheid. Onderweg kom je langs historische dijken, schilderachtige dorpjes en oude kerken, die allemaal een verhaal vertellen over het verleden van deze bijzondere regio. De wandeling biedt ook panoramische uitzichten over het water en de omliggende natuur. Verken de unieke charme van het voormalige eiland Wieringen tijdens deze onvergetelijke wandeling.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EExperience a magical walk around the former island of Wieringen and discover its rich history and breathtaking landmarks. This enchanting route takes you on a journey through time while you enjoy the beautiful landscape and natural beauty. Along the way, you'll encounter historical dikes, picturesque villages, and ancient churches, all of which tell a story about the past of this remarkable region. The walk also offers panoramic views of the water and surrounding nature. Explore the unique charm of the former island of Wieringen during this unforgettable hike.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EErleben Sie einen zauberhaften Spaziergang rund um das ehemalige Eiland Wieringen und entdecken Sie seine reiche Geschichte und atemberaubende Sehenswürdigkeiten. Diese bezaubernde Route entführt Sie auf eine Reise durch die Zeit, während Sie die wunderschöne Landschaft und natürliche Schönheit genießen. Unterwegs stoßen Sie auf historische Deiche, malerische Dörfer und alte Kirchen, die alle eine Geschichte über die Vergangenheit dieser bemerkenswerten Region erzählen. Der Spaziergang bietet auch einen Panoramablick auf das Wasser und die umliegende Natur. Erkunden Sie den einzigartigen Charme des ehemaligen Eilands Wieringen während dieser unvergesslichen Wanderung.\u003C\u002Fp\u003E",file:"wieringen",km:"28",image:n,isBike:a,startingPointId:c}]}],fetch:[],mutations:[]}}(true,"Winkels","64c172d41616be6f2ca590f0",{},"64c1734c1616be6f2ca590f1",{},"Bezienswaardigheden",false,"Stroe Route","\u003Cp\u003EOntdek het pittoreske Stroe op het eiland Wieringen met een betoverende wandeling langs historische bezienswaardigheden. Deze unieke route neemt je mee door schilderachtige landschappen en biedt een fascinerend inzicht in de rijke geschiedenis van deze regio. Verken charmante dorpjes, bewonder oude monumenten en geniet van adembenemende uitzichten over het landschap. Of je nu een natuurliefhebber bent of geïnteresseerd bent in cultureel erfgoed, deze wandeling door Stroe zal zeker een onvergetelijke ervaring zijn.\u003C\u002Fp\u003E","\u003Cp\u003EDiscover picturesque Stroe on the island of Wieringen with an enchanting walk along historical landmarks. This unique route takes you through scenic landscapes and offers a fascinating insight into the rich history of this region. Explore charming villages, admire ancient monuments, and enjoy breathtaking views of the countryside. Whether you're a nature enthusiast or interested in cultural heritage, this walk through Stroe will undoubtedly be an unforgettable experience.\u003C\u002Fp\u003E","\u003Cp\u003EEntdecken Sie das malerische Stroe auf der Insel Wieringen bei einem bezaubernden Spaziergang entlang historischer Sehenswürdigkeiten. Diese einzigartige Route führt Sie durch malerische Landschaften und bietet faszinierende Einblicke in die reiche Geschichte dieser Region. Erkunden Sie charmante Dörfer, bewundern Sie alte Denkmäler und genießen Sie atemberaubende Ausblicke auf die Landschaft. Ob Sie ein Naturliebhaber sind oder an kulturellem Erbe interessiert sind, dieser Spaziergang durch Stroe wird mit Sicherheit ein unvergessliches Erlebnis sein.\u003C\u002Fp\u003E","stroe.jpg","wieringen.jpg")));